import React, { useState, useRef, useEffect } from "react";

const Order = ({ orderObject }) => {
  // States
  const [open, setOpen] = useState(false);

  // Functions
  const toggleOpen = () => {
    setOpen(!open);
  };

  return (
    <React.Fragment>
      <div className="order">
        <button onClick={setOpen(!open)}></button>
      </div>
    </React.Fragment>
  );
};

export default Order;
